import React from "react";
import {Tile} from '../tile/Tile';
export const TileList = ({arr}) => {
  const map = arr.map()
  return (
    <div>
      {arr.map((obj,i) => {
        //<p>hello</p>
        <Tile name = {obj.name} description = {{phoneNumber: obj.phoneNumber, email: obj.email}} key = {i} />
        })
      }
    </div>
  );
};
